import React from 'react';
import './homepage.css';

const Homepage = ({ user, setLoginUser }) => {
  return (
    <div className="homepage">
      <p>Lorem20</p>

      {user && user._id ? (
        <div className="button" onClick={() => setLoginUser({})}>
          Logout
        </div>
      ) : (
        <div className="button" onClick={() => setLoginUser({})}>
          Login
        </div>
      )}
    </div>
  );
}

export default Homepage;
